css:
@-moz-document url("https://spbexchange.ru/ru/market-data/charts/") {

div.content__inner {

    margin-top: 0;

}

.content__inner {

    margin-top: 0;

    max-width: 99999999px;

    margin-left: 0;

    margin-right: 0;

    display: flex;

    align-items: flex-start;

    padding-bottom: 0;

}

#content_right {

    padding: 0;

    padding-left: 0;

}

#anketolog-widget-button, #content_right > p, #content > div > div.sidemenu, div#content_right h1, div.breadcrumbs, #header, #footer-new {

    display: none

}

iframe {

    position:absolute;

    top:0;

    left:0;

    width:100%;

    height:100%;

}
}
